import styled from "styled-components";

export const Container = styled.div`
color: red;
width: 100%
height: 100%;
background: rgba(0, 0, 0, 0.8);
position: absolute;
left: -20em;
top: -15em;
display: flex;
justify-content: center;
border-radius: 10px;
align-items: center;
`;
